import React from 'react'
import './style/ListItems.css'
function ListItems() {
    const data = [

        { id: 1, task: "John Doe" },

        { id: 2, task: "Victor Wayne" },

        { id: 3, task: "Jane Doe" },

      ];


      return (

        <div className="users">

          {data.map((user) => (
            <div className="user">
            <div>{user.task}</div>
            <input type="radio"/>
            </div>
          ))}

        </div>
  )
}

export default ListItems
